const getClubLogo = name => {
  const club = clubLogos.find(club => club.name === name);
  return club && club.club_logo;
};

const teamSquads = {};
players.forEach((item) => {
  const teamName = item[3];
  const team = clubs.find(club => club.name === teamName);
  if (team) {
    if (teamSquads[team.id]) {
      teamSquads[team.id].push({ name: item[2], pos: item[1], club: item[4], club_logo: getClubLogo(item[4]) });
    } else {
      teamSquads[team.id] = [{ name: item[2], pos: item[1], club: item[4], club_logo: getClubLogo(item[4]) }];
    }
  }
});


const fs = require('fs');

const outputPath = 'src/fxconstants/teamSquadObj.json';
fs.writeFile(outputPath, JSON.stringify(teamSquads), 'utf8', () => {
  console.log(`${outputPath}: OK`);
});
